import React from "react";
import "./Checkout1component.css"
import logo from "./Assets/icon.png"


const Checkout1component = () => {
    return (
        <div>
            <nav className="navbarcom ">
                <div className="navbarlogo navbar-center" ><img src={logo} width={30} /></div>
                <div className="navbartext1com" >eBAZAAR</div>
            </nav>
        </div>
    )

}
export default  Checkout1component
